CREATE TABLE `cardemoweb` (
  `id` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '货代找车源临时表的主键',
  `currentlocation` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '当前坐标',
  `STATUS` char(1) COLLATE utf8_bin DEFAULT '0' COMMENT '用户状态 默认值0,0：正常， 1禁止',
  `carcredit` double DEFAULT '0' COMMENT '积分/星级',
  `creditcount` int(11) DEFAULT '0' COMMENT '成交次数',
  `carcity` varchar(45) COLLATE utf8_bin DEFAULT NULL COMMENT '当前城市',
  `carno` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '车编号',
  `carstatus` int(11) DEFAULT '0' COMMENT '车状态',
  `leftload` double DEFAULT NULL COMMENT '剩余载重',
  `license` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '车牌号',
  `targetcity` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '行车路线',
  `cartype` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '车型',
  `carlength` double DEFAULT NULL COMMENT '车长',
  `company` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '所属公司',
  `totalload` double DEFAULT NULL COMMENT '载重',
  `memo` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '说明/描述',
  `generatetime` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `NAME` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '姓名',
  `tel` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '电话',
  `agentid` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '货代id',
  `localcity` varchar(45) COLLATE utf8_bin DEFAULT NULL COMMENT '车归属地',
  `dstatus` varchar(4) COLLATE utf8_bin DEFAULT NULL COMMENT '司机是否验证 默认值0, 0验证 1未验证',
  `photo` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '照片',
  `updatetime` datetime DEFAULT NULL COMMENT '发布运力时间',
  `mtype` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '0新增车队,1收藏车队,2公共车源'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin AVG_ROW_LENGTH=521;
