DROP TABLE IF EXISTS `goodsbak`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `goodsbak` (
  `id` varchar(128) COLLATE utf8_bin NOT NULL,
  `assigncarno` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '发布对象 指定车辆 [空：全部]',
  `count` int(11) DEFAULT NULL COMMENT '货物件数',
  `declaredvalue` int(11) DEFAULT NULL COMMENT '声明价值',
  `infofare` int(11) DEFAULT NULL COMMENT '信息费',
  `fare` int(11) DEFAULT NULL COMMENT '运价/费',
  `fetchdate` datetime DEFAULT NULL COMMENT '有效时间点',
  `goodsname` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '货物名称',
  `goodsno` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '货源编号',
  `goodstype` int(11) DEFAULT NULL COMMENT '货源类型',
  `originalprovince` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '发货地省',
  `originalcity` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '发货地城市',
  `originalregion` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '发货地区',
  `completedate` datetime DEFAULT NULL COMMENT '完成时间',
  `generatetime` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `receiptprovince` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '收货地省',
  `receiptcity` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '收货地城市',
  `receiptregion` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '收货地区',
  `carlength` double DEFAULT NULL COMMENT '车长',
  `volume` double DEFAULT NULL COMMENT '货物体积',
  `weight` double DEFAULT NULL COMMENT '吨位 重量',
  `agentid` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '货代id',
  `memo` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '描述',
  `paystatus` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '付款方式 0货代付款，1回单付款',
  `backstatus` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '回单状态，默认null，0原件，1传真件，2扫描件',
  `shipperid` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '发货联系人id',
  `consigneeid` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '收货联系人id',
  `custom` char(1) COLLATE utf8_bin DEFAULT '0' COMMENT '公司发布的私有货源还是货代发布的货源，默认0是货代发布的货源，1是公司发布的',
  `STATUS` char(1) COLLATE utf8_bin DEFAULT '0' COMMENT '状态：0,正常；1,删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin AVG_ROW_LENGTH=2340;
/*!40101 SET character_set_client = @saved_cs_client */;

