DROP TABLE IF EXISTS `ordersbak`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `ordersbak` (
  `id` varchar(128) COLLATE utf8_bin NOT NULL,
  `completetime` datetime DEFAULT NULL COMMENT '订单完成时间',
  `generatetime` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `orderno` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '订单编号',
  `status` char(2) COLLATE utf8_bin DEFAULT NULL COMMENT '订单状态',
  `agentid` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '货代id',
  `carid` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '司机id',
  `goodsid` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '货源id',
  `consigneeid` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '收货人',
  `shipperid` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '发货人',
  `photo` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '图片地址',
  `leavelocation` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '揽货时的坐标字段',
  `memo` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '拒签信息',
  `signtime` datetime DEFAULT NULL COMMENT '签收拒签时间',
  `type` char(1) COLLATE utf8_bin DEFAULT '0' COMMENT '判断是否删除,0是未做删除操作,1是货代删除,2是司机删除',
  `ordercustom` char(1) COLLATE utf8_bin DEFAULT '0' COMMENT '标识是个人货代订单还是公司订单，默认0是个人货代',
  `priseid` varchar(128) COLLATE utf8_bin DEFAULT NULL COMMENT '公司id',
  `weight` double DEFAULT NULL COMMENT '吨位',
  `volume` double DEFAULT NULL COMMENT '容积',
  `goodscustom` char(1) COLLATE utf8_bin DEFAULT '0' COMMENT '标识是公共货源订单还是自有货源订单，默认0是公共货源订单',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;
